content:
Сюжет, где я учусь одновременно в ВУЗе в своём городе и МАИ. Большую часть предметов в первом мне закрывают из-за того, что я аналогичную программу в МАИ прохожу, но пару раз в семестр мне приходится приезжать и нагонять.
В очередной раз приехал. Какой-то гуманитарный предмет, связанный с менеджментом. Прикольны лектор. Не особо слушаю, по большей части прикалываемся с [[человек.медведев_кирилл_викторович|Кириллом]] (я хз, откуда он тут взялся). Я болтаю со здешними первокурсниками.
}

Решил пойти с [[человек.медведев_кирилл_викторович|Кириллом]] на военку тайком. Сначала был марш на улице, потом нас повели в компьютерный класс, в котором мы должны были в какой-то модифицированной версии майнкрафта учиться каким-то трюкам. Я ничего не знал и потихоньку обучался. Там что-то делали в качестве учеников [[человек.калямина_кира_владимировна|Кира]] и [[человек.карепонова_анна|Аня]] (Карепонова), что-то попробовали подсказать мне, но по итогу высрали херню. Довольно хорошо в какой-то момент освоился.
Нужно было проходить испытания на время. Игра подразумевала принчтие большого количества решений за очень маленькое время, тренируя навыки импровизации и находчивости
}

- алгоритмы
- понимаете, как устроены сети связи и основные сетевые протоколы (IP, TCP, UDP, HTTP, REST, BitTorrent, gRPC);
- знаете базы данных и SQL;
- работали с командной строкой Unix (Ubuntu) и OPS (администрирование, работа с Linux);
- понимаете принципы многопоточного программирования;
- имеете опыт параллельных или распределенных вычислений;
- знаете основные паттерны ООП (самостоятельно реализовывали и использовали их).

```go
m := Type[elemNumber]{}
```
В качестве elemNumber можно оставить …, тогда компилятор сам посчитает его по количеству элементов в композитном литерале.
Фишка с указанием определённых индексов для инициализации:
```go
//создаст массив из 100 элементов с единственным ненулевым - сотым элеметом
m := int[...]{99:-1}
```
Два массива можно сравнить, если он хранит сравниваемый тип.

{ #Персонаж_Марат - 19 лет, наблюдатель-психология
Поездка Рональда Рейгана в Северную Корею под руководством Ким Ир Сена. Народ восстаёт против последнего. Рейгана эвакуируют. Ким перед смертью толкает речь.
}

Живём с [[человек.вещина_оксана_аркадьевна|матерью]] в квартире. Она заводит ещё трёх кошек, что меня сильно выбешивает, так что я убегаю из дома через окно. По крышам добираюсь туда, где у меня проходили дошкольные занятия. Меня находит бабушка и отводит обратно.
Проходит семь лет. Я случайно забредаю в то же здание. Натыкаюсь на потерявшуюся девочку и помогаю ей найти родителей. Меня наполняет приятное чувство
}

Проник на какую-то территорию. Спрятался в подвале. Там меня нашли и заперли. Как-то выбрался.
Очень длинный и подробный сон. Уже к концу стал понимать, что начинаю забывать его начало. Раза четыре во сне его записывал, в памяти осталось очень мало
}

Дети-первокурсники выступали на каком-то конкурсе в Кинешме. Я не смог приехать их поддержать, поэтому тусовался с ними по видеосвязи.
До этого сам выступал на том же конкурсе, так что, судя по всему, их участие - в том числе моя заслуга.
}

{
[[человек.воронин_илья_алексеевич|Илью]] забрали на какую-то войну. Меня тоже потом призвали - он уже как командир занимался моей подготовкой
}

> zero value - `nil`
## Объявление
```go
func funcName (inputParamList) (outputParamList) {
//some code
return outputParamList
}
```
В `return` можно не указывать возвращаемые переменные, но тогда необходимо в объявлении в `outputParamList` указывать не просто тип возвращаемых значений, но и их имена.
## Сигнатура
Набор из упорядоченных входных и выходных параметров.
## Вариативные фукнции
Это функции с произвольным количеством аргументов. Для объявления такой необходимо поставить `…` перед последним типом. Работать с таким аргументом необходимо как со [[go.конспект.типы.встроенные%.срез#Срез|срезом]].
```go
func nameFunc(someArgs, last ...Type) {
for _, elem := range last {
}
}
```
## Анонимные функции
Функции могут быть анонимными (без имён):
```go
some_name := func(input_parameters) (ouput_parameters) {
//some code
}
```
Анонимная фукнция имеет доступ к внешней зоне видимости.
Для создания рекурсивных анонимных функций необходимо объявить сначала [[go.конспект.переменные#Переменные|переменную]] с типом нужной сигнатуры, а затем присвоить [[go.конспект.переменные#Переменные|переменной]] эту функцию, вызывая в ней неё же через эту [[go.конспект.переменные#Переменные|переменную]].
Возможен вот такой прикол:
```go
func(input_parameters) (output_parameters){
//some code
}(input_parameters) //объявление с вызовом
```

{ #Персонаж_Марат - 19 лет
Мистер и Мисс 8. В конкурсе почему-то участвует [[человек.ибрашов_джамал_ербулатович|Джамал]] - мой староста. Все выступили, жюри очень долго не оглашает победителя. В итоге выигрывает он.
}

{ #Персонаж_Марат - 21 год
Сидел в квартире в Иваново. Большую часть событий не помню. Перед глазами картинка - я выхожу на балкон ночью, и в небе «висит» ещё одна земля и луна в половину неба. Надо нарисовать
}

{
Сначала снилось, что я во сне занимаюсь всякими пошлостями. При этом изредка просыпался (во сне) и оглядывался. Гипер реалистичный сон. После того, как закончил, решил проснуться (всё ещё во сне). Сразу понял, что сон. По приколу решил делать сальтухи на месте. Позабавило то, что мне явно не хватала скорости для того, чтобы приземлиться на ноги, но сон в последний момент как бы докручивал меня до устойчивого положения. Вышел из комнаты, стал ходить по общежитию. Делаю замечание парочке, что повела детей мыться в общий душ. После этого хожу брожу. Надоело, решаю проснуться. Просыпаюсь во сне ещё раз. Сон становится ещё более гипер реалисьичным. Решил попробовать сделать сальто, чтобы проверить, сон ли это. Сон также меня докручивает, так что я решаю, что это сон. Погулял по общаге. Думал выйти на улицу, но решил, что сон не прогрузит за пределами ничего. Но услышал голос (хотя было больше похоже на то, что в голову было вложено знание в виде голоса), намекающий на то, что на этот раз там что то есть.
Вылетел из общаги. Голос не обманул. То место уже было во сне, где после перепуться не было прорисовано (второй сон из https://t.me/SnU_mafiramul/497). Мозг был готов и он дал мне это понять. Вылетел. Зима. Начал лететь вверх, чтобы осмотреться, раз уж нечего делать. Не очень получалось. Откуда-то появились [[человек.панкина_елизавета_дмитриевна|Лиза]] и [[человек.мышкина_варвара_владимировна|Варя]] со школы кураторов, сказали мне что-то, и у меня стало получаться стабильно взлетать. Увидел здание, заросшее какой-то изумружной растительностью. На линии, соединяешей его и здание, откуда я вышел, находился огромный комплекс храмов из красного и белого кирпича, поросшего такой же растительностью. Со временем заросли пропали и у его входа появилась женщина цыганской внешности, которая сказала, что мне нужно будет найти в следующий раз этот комплекс по ориентиру: на пересечении места, откуда я вышел и заросшего здания.
Очень крутая вещь. На моей памяти, таких реалистичных по восприятию снов у меня не было. Забавляет эта ситуация с цыганкой. Было бы, конечно дико прикольно сегодня во сне увидеть продолжение. Цыганка по вайбу похожа на [[сны.персонажи.внешние%.тронди|Тронди]], но это не она. Тронди всё-таки больше по возрасту со мной схожа, а цыганка была прям зрелой. Неужели новый персонаж? Забавно, на что способен наш собственный мозг
}

### Вид
- `declaring` - объявление переменных
- `condition` - условное выражение
```go
if declaring; condition {
// some code
} else if declaring; condition; {
// some code
} ... {
} else {
// some code
}
```
### Примечания
- Все части опциональны. Если `condition` упускается, то подставляется `true`.
- Переменные, объявленные в любой части `if` будут находиться в зоне действия всего выражения.

> zero value - `0`
## Множество значений
```go
int8  {                      -128;                        127}
int16 {                   -32 768;                     32 767}
int32 {            -2 147 483 648;              2 147 483 647}
int64 {-9 223 372 036 854 775 808;  9 223 372 036 854 775 807}
int
rune
```
- `int` будет совпадать с `int32` или `int64` в зависимости от машины
- `rune` - псевдоним к `int32`, используемый при работе с unicode-символами

